body:
This addition that promotes code reuse and executing parsers from parent/sibling models. it's merely an exposed function that was took from inside the `$setViewValue`. It's useful to execute the parsers from the current ngModel $viewValue or an arbitrary string, without messing with the `$viewValue` and `$modelValue`, without triggering the events that `$setViewValue` triggers.

For example:

```js
var test = angular.module('test', []);
test.directive('test', function(){
  return {
    'require': 'ngModel',
    'link': function($scope, $el, attrs, model){
      model.$parsers.push(function(value){
        return value.replace(/-/g, '|');
      });
      model.$setViewValue('loop-hole');
    }
  };
});

test.directive('test2', function(){
  return {
    'require': 'ngModel',
    'template': '<input type="button" data-value="{{x}}" value="{{$parent.value}}">',
    'link': function($scope, $el, attrs, model){
      $scope.x = '';

      $el.on('click', function(){
        $scope.x = model.$parse($el.val()); // arbitrary value, if the value is COOL-GANG, it returns to COOL|GANG
        //$scope.x = model.$parse(); // current $viewValue, loop-hole, that returns loop|hole, which is obviously the current $modelValue, so not much of use
      });
    }
  };
});
```

@IgorMinar love what you've done with $resource, please take a look at the relationship implementation below.

Remember that once you have the primary key for one level, you usually don't need to include the levels above because you've already got your specific object. In other words, you shouldn't need too many cases where a URL is deeper than 2 levels deep eg `/resource/identifier/resource`. (http://info.apigee.com/Portals/62317/docs/web%20api.pdf)

Example
```javascript
var CreditCard = $resource('/card/:cardId', {cardId:'@id'}, {
  charge: {method:'POST', params:{charge:true}}
});
var User = $resource('/user/:userId', {userId:'@id'}, {}, {CreditCard:CreditCard});
var cards = User.CreditCard.query({userId:123}, function() {
  // GET: /user/123/card
  // server returns: [ {id:456, number:'1234', name:'Smith'} ];

  var card = cards[0];
  // each item is an instance of CreditCard
  expect(card instanceof CreditCard).toEqual(true);
  card.name = "J. Smith";
  // non GET methods are mapped onto the instances
  card.$save();
  // POST: /card/456 {id:456, number:'1234', name:'J. Smith'}
  // server returns: {id:456, number:'1234', name: 'J. Smith'};

  // our custom method is mapped as well.
  card.$charge({amount:9.99});
  // POST: /card/456?amount=9.99&charge=true {id:456, number:'1234', name:'J. Smith'}
});
```
